import React from 'react';
import { makeStyles, Card, CardActions, CardContent, Typography, CardActionArea, Grid} from '@material-ui/core';

const styles = makeStyles({
    root:{
        width: "240px",
        height: "150px"
    },


})

function UnitCard() {

    const UnitList = [
        {
            unit: 'Math',
            topic: 'calculus',
            grade: 60
        },

        {
            unit: 'Chem',
            topic: 'inorganic chem',
            grade: 60
        },

        {
            unit: 'Bio',
            topic: 'cells',
            grade: 60
        },

        {
            unit: 'Physics',
            topic: 'inertia',
            grade: 60
        },
    ]

    const classes = styles();

    return (
        <div>
            {UnitList.map(val => (
                <Grid>
                <Card className={classes.root}>
                    <CardActionArea>
                        <CardContent align="center">
                            <Typography variant="h5">{val.unit}</Typography>
                            <Typography variant="h6">{val.grade}%</Typography>
                            <Typography variant="h7">{val.topic}</Typography>
                        </CardContent>
                    </CardActionArea>
                </Card>
                </Grid>
            ))}
        </div>
    )
}

export default UnitCard
